import '../App.css';
import React,{useState, useEffect} from "react";
import {useNavigate } from 'react-router-dom';
import axios from 'axios';
import hodu from '../giddyUpHodu.png'

function Mypage(){
    const [id, setId] = useState('')
    const navigate = useNavigate()
    useEffect(() => {
        //getID();
    }, [])

    const getID=()=>{
        axios.get('/getID')
        .then((res)=>{
            setId(res.data)
        })
    }
    return(
        <div className='todo-container'>
            <h1 style = {{fontSize : 50}}>{id}'s Ho-Do List</h1>
            <div style={{textAlign : "center", marginTop: 30}}>
                <img style={{width:300}}src={hodu}/>

                <button className = 'purpleButton' style = {{marginTop: 20, height:50, fontSize:20, width:"30%"}} 
                onClick={()=>{navigate('/list')}}>Back</button>
            </div>
        </div>
    )
}

export default Mypage
